product1800 = Refinery::Ironman::Product.create!(product_no:'24716FE', name:'Xterra 2005+ Front Strut - Foam Cell', description:'Ironman Foam Cell provides the ultimate in 4x4 shock absorber design and features with 50% more oil for cooler running. Exceptional performance for both standard and raised height 4x4’s & superior ride control and comfort both on and off road is what you can expect from these shock absorbers. The shocks, designed by Ironman 4x4 suspension engineers, have been individually made component by component to produce the world’s finest offroad shock absorber. Each and every Ironman shock absorber is force velocity tested before packaging to ensure all parts received are uniform and within operating specification. High quality materials such as German Fuchs High temp shock absorber fluid, Japanese NOK multilip seals are used. Strength and durability requirements are sorted by the use of re-enforced single piece eye rings and stems. Rubber shock absorber bushes are used by Ironman, this is to promote maximum flexibility and reduction in unwanted side load and NVH (Noise Vibration Harshness) transmission which often causes seal failures in other brand shock absorbers using Polyurethane.', notes:'Unnesessary fitment of trim packers may lift vehicle too high. Vehicles with independent suspension must maintain a minimum of 60mm downward suspension travel.', quantity_required:'2', price:'187', specifications_attributes:[{title:'Estimated Lift', value:''}, {title:'Additional Load', value:''}, {title:'Package Details', value:'Each'}, {title:'Attributes', value:'Height Adjustable Spring Seat (with trim packer)'}, {title:'Engines', value:''}, {title:'Model Years', value:''}, {title:'Monocoque Bodies', value:''}, {title:'Additional Notes', value:''}, {title:'When Ordering', value:''}], draft:true) if not '24716FE'.blank?;	vehicle1800 = Refinery::Ironman::Vehicle.find_or_create_by_path(['Nissan', 'Xterra', '2005+']) if 'Nissan'.present?; 	product1800.vehicles