product2341 = Refinery::Ironman::Product.create!(product_no:'12637GRC', name:'Landcruiser 70, 73, 74 Series (Leaf, Leaf) 1984-1988 Front Shock Absorber - Nitro Gas Comfort', description:'Ironman 35mm bore Nitro Gas Shocks are the rugged all round 4x4 performance shock absorber. Ironman Nitro Gas Shocks provide exceptional performance for both standard and raised height 4x4’s whilst delivering superior ride control and comfort both on and off road. Improve stability when towing or carrying a load. Each and every Ironman shock absorber is force velocity tested before packaging to ensure all parts received are uniform and within operating specification. High quality materials such as German Fuchs High temp shock absorber fluid, Japanese NOK multilip seals are used. Strength and durability requirements are sorted by the use of re-enforced single piece eye rings and stems. Rubber shock absorber bushes are used by Ironman, this is to promote maximum flexibility and reduction in unwanted side load and NVH (Noise Vibration Harshness) transmission which often causes seal failures in other brand shock absorbers using Polyurethane.', notes:'', quantity_required:'2', price:'110', specifications_attributes:[{title:'Estimated Lift', value:''}, {title:'Additional Load', value:''}, {title:'Package Details', value:'Each'}, {title:'Attributes', value:''}, {title:'Engines', value:''}, {title:'Model Years', value:''}, {title:'Monocoque Bodies', value:''}, {title:'Additional Notes', value:''}, {title:'When Ordering', value:''}], draft:true) if not '12637GRC'.blank?;	vehicle2341 = Refinery::Ironman::Vehicle.find_or_create_by_path(['Toyota', 'Landcruiser', '70, 73, 74 Series (Leaf, Leaf) 1984-1988']) if 'Toyota'.present?; 	product2341.vehicles << vehicle2341 if vehicle2341.present? and product2341.present?;	category2341 = Refinery::Ironman::Category.find_or_create_by_path(['Suspension','Shock Absorbers']) if 'Suspension'.present?; 	product2341.categories << category2341 if category2341.present? and product2341.present?
