product2403 = Refinery::Ironman::Product.create!(product_no:'1144SK', name:'Landcruiser 71 Series Polyurethane Caster Bush Kit', description:'2° Caster Correction Bushes are available for selected vehicles. Produced from high density injection moulded polyurethane. Highly recommended for raised height 4x4`s up to 75mm lift to permanently cure vehicle wonder. 2 Degree Caster Correction Bushes are available for selected vehicles.', notes:'Adjustment is achieved by the rotation position of the inner steel tube. Caster angle is the backward or forward tilt of the differential steering axis. Positive caster is needed in most applications within front suspension in 4x4 vehicles. When a vehicle is lifted via raised springs, this positive angle is reduced. The reduced caster angle will detract feeling and response through the steering wheel. This will also cause reduced self-centring and possible wheel shimmy in extreme cases. The offset in the bushes will tilt the differential (positive) back toward manufacturers specification thus greatly improved handling and feel. Highly recommended for raised height 4x4`s up to 75mm lift to permanently cure vehicle wonder.', quantity_required:'1', price:'121', specifications_attributes:[{title:'Estimated Lift', value:''}, {title:'Additional Load', value:''}, {title:'Package Details', value:'Set'}, {title:'Attributes', value:'2 Degree Offset'}, {title:'Engines', value:''}, {title:'Model Years', value:''}, {title:'Monocoque Bodies', value:''}, {title:'Additional Notes', value:''}, {title:'When Ordering', value:''}], draft:true) if not '1144SK'.blank?;	vehicle2403 = Refinery::Ironman::Vehicle.find_or_create_by_path(['Toyota', 'Landcruiser', '71 Series']) if 'Toyota'.present?; 	product2403.vehicles << vehicle2403 if vehicle2403.present? and product2403.present?;	category2403 = Refinery::Ironman::Category.find_or_create_by_path(['Suspension','Caster Correction']) if 'Suspension'.present?; 	product2403.categories << category2403 if category2403.present? and product2403.present?
