product2502 = Refinery::Ironman::Product.create!(product_no:'12091GR', name:'Landcruiser 78 Series 1999-2007 Front Shock Absorber - Nitro Gas', description:'Ironman 35mm bore Nitro Gas Shocks are the rugged all round 4x4 performance shock absorber. Ironman Nitro Gas Shocks provide exceptional performance for both standard and raised height 4x4’s whilst delivering superior ride control and comfort both on and off road. Improve stability when towing or carrying a load. Each and every Ironman shock absorber is force velocity tested before packaging to ensure all parts received are uniform and within operating specification. High quality materials such as German Fuchs High temp shock absorber fluid, Japanese NOK multilip seals are used. Strength and durability requirements are sorted by the use of re-enforced single piece eye rings and stems. Rubber shock absorber bushes are used by Ironman, this is to promote maximum flexibility and reduction in unwanted side load and NVH (Noise Vibration Harshness) transmission which often causes seal failures in other brand shock absorbers using Polyurethane.', notes:'', quantity_required:'2', price:'110', specifications_attributes:[{title:'Estimated Lift', value:''}, {title:'Additional Load', value:''}, {title:'Package Details', value:'Each'}, {title:'Attributes', value:''}, {title:'Engines', value:''}, {title:'Model Years', value:''}, {title:'Monocoque Bodies', value:''}, {title:'Additional Notes', value:''}, {title:'When Ordering', value:''}], draft:true) if not '12091GR'.blank?;	vehicle2502 = Refinery::Ironman::Vehicle.find_or_create_by_path(['Toyota', 'Landcruiser', '78 Series 1999-2007']) if 'Toyota'.present?; 	product2502.vehicles << vehicle2502 if vehicle2502.present? and product2502.present?;	category2502 = Refinery::Ironman::Category.find_or_create_by_path(['Suspension','Shock Absorbers']) if 'Suspension'.present?; 	product2502.categories << category2502 if category2502.present? and product2502.present?
