product2851 = Refinery::Ironman::Product.create!(product_no:'12795GR', name:'Landcruiser 100 Series Front Shock Absorber - Nitro Gas', description:'Ironman 35mm bore Nitro Gas Shocks are the rugged all round 4x4 performance shock absorber. Ironman Nitro Gas Shocks provide exceptional performance for both standard and raised height 4x4’s whilst delivering superior ride control and comfort both on and off road. Improve stability when towing or carrying a load. Each and every Ironman shock absorber is force velocity tested before packaging to ensure all parts received are uniform and within operating specification. High quality materials such as German Fuchs High temp shock absorber fluid, Japanese NOK multilip seals are used. Strength and durability requirements are sorted by the use of re-enforced single piece eye rings and stems. Rubber shock absorber bushes are used by Ironman, this is to promote maximum flexibility and reduction in unwanted side load and NVH (Noise Vibration Harshness) transmission which often causes seal failures in other brand shock absorbers using Polyurethane.', notes:'', quantity_required:'2', price:'110', specifications_attributes:[{title:'Estimated Lift', value:''}, {title:'Additional Load', value:''}, {title:'Package Details', value:'Each'}, {title:'Attributes', value:''}, {title:'Engines', value:''}, {title:'Model Years', value:''}, {title:'Monocoque Bodies', value:''}, {title:'Additional Notes', value:''}, {title:'When Ordering', value:''}], draft:true) if not '12795GR'.blank?;	vehicle2851 = Refinery::Ironman::Vehicle.find_or_create_by_path(['Toyota', 'Landcruiser', '100 Series']) if 'Toyota'.present?; 	product2851.vehicles << vehicle2851 if vehicle2851.present? and product2851.present?;	category2851 = Refinery::Ironman::Category.find_or_create_by_path(['Suspension','Shock Absorbers']) if 'Suspension'.present?; 	product2851.categories << category2851 if category2851.present? and product2851.present?
product2852 = Refinery::Ironman::Product.create!(product_no:'24795FE', name:'Landcruiser 100 Series Front Shock Absorber - Foam Cell', description:'Ironman Foam Cell provides the ultimate in 4x4 shock absorber design and features with 50% more oil for cooler running. Exceptional performance for both standard and raised height 4x4’s & superior ride control and comfort both on and off road is what you can expect from these shock absorbers. The shocks, designed by Ironman 4x4 suspension engineers, have been individually made component by component to produce the world’s finest offroad shock absorber. Each and every Ironman shock absorber is force velocity tested before packaging to ensure all parts received are uniform and within operating specification. High quality materials such as German Fuchs High temp shock absorber fluid, Japanese NOK multilip seals are used. Strength and durability requirements are sorted by the use of re-enforced single piece eye rings and stems. Rubber shock absorber bushes are used by Ironman, this is to promote maximum flexibility and reduction in unwanted side load and NVH (Noise Vibration Harshness) transmission which often causes seal failures in other brand shock absorbers using Polyurethane.', notes:'', quantity_required:'2', price:'154', specifications_attributes:[{title:'Estimated Lift', value:''}, {title:'Additional Load', value:''}, {title:'Package Details', value:'Each'}, {title:'Attributes', value:''}, {title:'Engines', value:''}, {title:'Model Years', value:''}, {title:'Monocoque Bodies', value:''}, {title:'Additional Notes', value:''}, {title:'When Ordering', value:''}], draft:true) if not '24795FE'.blank?;	vehicle2852 = Refinery::Ironman::Vehicle.find_or_create_by_path(['Toyota', 'Landcruiser', '100 Series']) if 'Toyota'.present?; 	product2852.vehicles << vehicle2852 if vehicle2852.present? and product2852.present?;	category2852 = Refinery::Ironman::Category.find_or_create_by_path(['Suspension','Shock Absorbers']) if 'Suspension'.present?; 	product2852.categories << category2852 if category2852.present? and product2852.present?
product2853 = Refinery::Ironman::Product.create!(product_no:'TOY050', name:'Landcruiser 100 Series Front Torsion Bars (Petrol)', description:'Ironman Torsion Bars are thicker than standard torsion bars fitted as original equipment. Original equipment torsion bars are designed to carry the weight of the vehicle as designed by their manufacturer. The adjustment incorporated in torsion bar vehicles is not intended to be used to compensate for carrying additional load. Additional 4x4 accessories such as a bull bar, winches and dual battery kit places enormous stress on standard torsion bars. Being uprated (thicker spring steel) Ironman torsion bars enhance ride comfort by controlling suspension travel whether carrying additional accessories or a full load of passengers. Ironman torsion bars will make your 4x4 safer while providing more comfortable cornering and braking efficiency. All Ironman torsion bars have upset forged ends and are pre set to minimise sag.', notes:'Suits Petrol Vehicles. Some middle easter vehicles may use longer torsion bars (TOY051), check length before ordering.', quantity_required:'1', price:'396', specifications_attributes:[{title:'Estimated Lift', value:''}, {title:'Additional Load', value:''}, {title:'Package Details', value:'Pair'}, {title:'Attributes', value:'Must install BRACKET100'}, {title:'Engines', value:''}, {title:'Model Years', value:''}, {title:'Monocoque Bodies', value:''}, {title:'Additional Notes', value:'Vehicles with independent suspension must maintain a minimum of 60mm downward suspension travel.'}, {title:'When Ordering', value:''}], draft:true) if not 'TOY050'.blank?;	vehicle2853 = Refinery::Ironman::Vehicle.find_or_create_by_path(['Toyota', 'Landcruiser', '100 Series']) if 'Toyota'.present?; 	product2853.vehicles << vehicle2853 if vehicle2853.present? and product2853.present?;	category2853 = Refinery::Ironman::Category.find_or_create_by_path(['Suspension','Torsion Bars']) if 'Suspension'.present?; 	product2853.categories << category2853 if category2853.present? and product2853.present?
