product2919 = Refinery::Ironman::Product.create!(product_no:'12691GR', name:'Prado 95 Series Front Strut - Nitro Gas', description:'Ironman 35mm bore Nitro Gas Shocks are the rugged all round 4x4 performance shock absorber. Ironman Nitro Gas Shocks provide exceptional performance for both standard and raised height 4x4’s whilst delivering superior ride control and comfort both on and off road. Improve stability when towing or carrying a load. Each and every Ironman shock absorber is force velocity tested before packaging to ensure all parts received are uniform and within operating specification. High quality materials such as German Fuchs High temp shock absorber fluid, Japanese NOK multilip seals are used. Strength and durability requirements are sorted by the use of re-enforced single piece eye rings and stems. Rubber shock absorber bushes are used by Ironman, this is to promote maximum flexibility and reduction in unwanted side load and NVH (Noise Vibration Harshness) transmission which often causes seal failures in other brand shock absorbers using Polyurethane.', notes:'Unnesessary fitment of trim packers may lift vehicle too high.', quantity_required:'2', price:'165', specifications_attributes:[{title:'Estimated Lift', value:''}, {title:'Additional Load', value:''}, {title:'Package Details', value:'Each'}, {title:'Attributes', value:'Height Adjustable Spring Seat (with trim packer)'}, {title:'Engines', value:''}, {title:'Model Years', value:''}, {title:'Monocoque Bodies', value:''}, {title:'Additional Notes', value:'Vehicles with independent suspension must maintain a minimum of 60mm downward suspension travel.'}, {title:'When Ordering', value:''}], draft:true) if not '12691GR'.blank?;	vehicle2919 = Refinery::Ironman::Vehicle.find_or_create_by_path(['Toyota', 'Prado', '95 Series']) if 'Toyota'.present?; 	product2919.vehicles << vehicle2919 if vehicle2919.present? and product2919.present?;	category2919 = Refinery::Ironman::Category.find_or_create_by_path(['Suspension','Shock Absorbers']) if 'Suspension'.present?; 	product2919.categories << category2919 if category2919.present? and product2919.present?
