product2981 = Refinery::Ironman::Product.create!(product_no:'TOY038B', name:'4Runner 180/185 Series 1996-2002 Front Performance Coil Springs (Petrol, no accessories)', description:'All Ironman coil springs are designed to provide a safe, comfortable ride while also providing additional ground clearance. Ironman 4x4 coil springs are CNC cold wound and bar peeled for maximum reliability and consistency, every coil spring is ‘shot-blasted’ to ensure long life, preset to its solid height and load tested to avoid spring sag. All springs are electro-static powder-coated for a gleaming appearance. Available in raised height and perfectly matched to Ironman 4x4 Shock Absorbers.', notes:'', quantity_required:'1', price:'187', specifications_attributes:[{title:'Estimated Lift', value:'45mm'}, {title:'Additional Load', value:'0-50kg'}, {title:'Package Details', value:'Pair'}, {title:'Attributes', value:''}, {title:'Engines', value:''}, {title:'Model Years', value:''}, {title:'Monocoque Bodies', value:''}, {title:'Additional Notes', value:'Vehicles with independent suspension must maintain a minimum of 60mm downward suspension travel.'}, {title:'When Ordering', value:'Select springs in accordance with your vehicles additional load.'}], draft:true) if not 'TOY038B'.blank?;	vehicle2981 = Refinery::Ironman::Vehicle.find_or_create_by_path(['Toyota', '4Runner', '1996-2002']) if 'Toyota'.present?; 	product2981.vehicles << vehicle2981 if vehicle2981.present? and product2981.present?;	category2981 = Refinery::Ironman::Category.find_or_create_by_path(['Suspension','Coil Springs']) if 'Suspension'.present?; 	product2981.categories << category2981 if category2981.present? and product2981.present?
